import React from 'react';
import leftBg from '../images/marshmallow-banner-img-1.png';
import rightBg from '../images/marshamallow-banner-img-2.png';
import {GoLocation} from 'react-icons/go' ;
import MyVerticallyCenteredModal from './restaurants-client/MyVerticallyCenteredModal';
function Home(){
    return(
        <div className="banner-home">
     <div className="row">
            <div className="col-3">
<img className="leftBg" src={leftBg} alt="" />
            </div>
            <div className="col-6">
                <h1>Order food online in Egypt</h1>

                <input className="form-control" type="text" placeholder="Search for area, street name, landmark..." />
        <span className="location"><GoLocation /></span>
    <span className="map-location"><MyVerticallyCenteredModal/></span>
    <div class="input-group mb-3">
  <span class="input-group-text">$</span>
  <input type="text" class="form-control" aria-label="Amount (to the nearest dollar)"/>
  <span class="input-group-text">.00</span>
</div>

            </div>
            <div className="col-3">
            <img  className="rightBg" src={rightBg} alt="" />
            </div>
        </div>
        </div>

    );
}
export default Home;
